	add("dorveille", "{\"term\":\"dorveille\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A dreamlike semi-conscious state, such as while falling asleep or waking up, between periods of sleep, or from exhaustion; generally with reference to an altered mental state where there is no distinction between the fantastic and the familiar. Most often used in reference to medieval poetry and literature\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, James J. Paxson, \u0027The Poetics of Personification\u0027, p. 9\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"dorveille\u0027\u0027\u0027 is a peculiar psychic, physical, and spiritual condition traditionally suffered by the narrator or human protagonist of the allegorical poem. \u0027\u0027\u0027Dorveille\u0027\u0027\u0027 can involve the bodily exhaustion that overcomes the narrator at the outset of his text. The classic example is Dante, who, at the opening of \u0027Inferno\u0027 1, describes himself as \u0027pien di sonno\u0027 – \u0026quot;full of sleep\u0026quot; (line 11). \u0027\u0027\u0027Dorveille\u0027\u0027\u0027 can also involve the hypnotic lull and dizziness that overcomes the weary horseman who, as he narrates his poem, suffers from a wandering sense of attention and alertness (French \u0027rever\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Emily Francomano \u0027Wisdom and Her Lovers in Medieval and Early Modern Hispanic Literature\u0027, p. 7\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The poetic voice describes how, sleepless with lovesickness, he goes to the chapel, seeking respite. As he meditates there upon the cause of his \u0026quot;passion\u0026quot;, he [...] enters into a state of \u0027\u0027\u0027dorveille\u0027\u0027\u0027 and has a vision populated with women\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Christine de Pizan, David Hult, \u0027Debate of the Romance of the Rose\u0027, p. 10\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"the narrator is in a dreamlike state midway between sleep and wakefulness, [...] \u0026quot;\u0027\u0027dorveille\u0027\u0027\u0026quot;, a state that accentuates the inability to tell whether the events being recounted really happened or not\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Robert Moss, \u0027Active Dreaming: Journeying Beyond Self-Limitation to a Life of Wild Freedom\u0027, pp. 21, 4\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Among indigenous and early peoples, the liminal state of \u0027\u0027\u0027dorveille\u0027\u0027\u0027 (sleep-wake) is a time when you might stir and share dreams with whoever is available. [...] Sometimes a whole poem or song is delivered within a dream or in that fluid in-between zone of sleep-wake, \u0027\u0027\u0027dorveille\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Anne Marie D\u0027Arcy, \u0027Wisdom and the Grail\u0027, p. 9\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Lancelot] has witnessed the miraculous cure of his fellow knight, but he understands nothing of what he has seen in his somnolent \u0027\u0027\u0027dorveille\", \"priority\":11}]}, \"synonyms\":{}}");

